import { StatusBar } from 'expo-status-bar';
import React from 'react';
import { StyleSheet, Text, View ,ImageBackground, Button, Alert, Modal } from 'react-native';


const image={uri:"https://reactjs.org/logo-og.png"};
export default function App() {

  // const imagesrc2={"Aquaman.jpg"};
  return (
    <View style={[styles.container, {flexDirection: "column"}]}>
    {/* <ImageBackground source={require('./Aquaman.jpg')} resizeMode="cover" style={styles.image}> */}
    <ImageBackground source={image} resizeMode="cover" style={styles.image}>

      <View style={styles.container}>
        <StatusBar 
          animated={true}
          backgroundColor="#61dafb"></StatusBar>

          <Text style={styles.text}>Open up App.js to start working on your app!</Text>
          <View >
            <Button title="hello" onPress={() => Alert.alert('Button pressed')} style={styles.button}></Button>
          </View>
          <Modal style={styles.modal}>
            <Text style={styles.text}>Yo Yo Bitches!</Text> 
          </Modal>
          </View>
      <View style={[styles.lowerContainor,{justifyContent: "space-around"}]}>
        <Button style={styles.button2} title="hello"></Button>
        <Button style={styles.button2} title="bolo"></Button>
        <Button style={styles.button2} title="bolo"></Button>
        <Button style={styles.button2} title="bolo"></Button>
        <Button style={styles.button2} title="bolo"></Button>
        <Button style={styles.button2} title="bolo"></Button>
      </View>
      </ImageBackground>
      </View>

  );
}

const styles = StyleSheet.create({
  basecontainer:{
    flex: 1,
    // backgroundColor: 'skyblue', 
    alignItems: 'center',
    // justifyContent: 'center',
  },
  container: {
    flex:5,
    alignItems: 'center',
    // justifyContent: "space-around",
  },
  lowerContainor:{
    flex:1,
    flexDirection: "row",
    position: "absolute",
    bottom:"5%",
    left:"40%",
    alignSelf:"stretch",
    // justifyContent: "space-around",
    alignItems:"center",
  },
  image: {
    flex: 1,
    color:"#f0f",
    alignSelf:"stretch",
    justifyContent: "center"
  },
  button:{
    alignSelf:"center",
    fontSize:40,
    color:"#7fff00",
    backgroundColor:"#00bfff",
    height:"100%",
  },
  button2:{
    // backgroundColor:"#dc143c",
    height:50,
    color:"#dc143c",
    alignSelf:"center",
    height:"100%",
  },
  text:{
    color: "white",
    fontSize: 30,
    fontWeight: "bold",
    textAlign: "center",
    backgroundColor: "#000000c0"
  },
  modal:{
    color:"White",
    backgroundColor:"White",
    justifyContent:'center',
    alignSelf:"center",
  },
});
